import React, { Component } from 'react';
import { render } from 'react-dom';
import MyForm from './myForm';
import './style.css';

class App extends Component {
  constructor() {
    super();
  }

  render() {
    return (
      <div id="container" style={{"borderRadius" : "25px", "backgroundColor" : "black"}}>
        <MyForm />
      </div>
    );
  }
}

render(<App style={{"backgroundColor" : "black"}} />, document.getElementById('root'));
